import React, { Component } from 'react'
import FeedItem from './plateFeedItem'
import Axios from 'axios'
// import Search from './autoCompSearch'

let FeedStyle = {
    marginLeft: '20px',
    backgroundColor: '#fff',
    overflow: 'scroll'
}

class platesFeed extends Component {

    state = {
        plateCollection: []
    }

    componentDidMount(){
        // get data from db
        Axios.get('/getPlates')
        .then((data) => {
            this.setState({plates: data})
        }).catch(e => console.log(e))
    }

    render(){
        return(
            <div className={FeedStyle}>
                <h1>Active Plates</h1>
                <FeedItem plateNumber='12345-69'></FeedItem>
            </div>
        )
    }
}

export default platesFeed
